sys_variable_value.value:
(function execute(inputs, outputs) {
    var data = new Array();
    var document;
    var documents = new Object();

    if (inputs.statuscode == '200') {
        try {
            var response_json = JSON.parse(inputs.responseBody);
          	outputs.list_bucket = response_json;
            for (var i = 0; i < response_json.length; i++) {
                var document = new Object();
                document.label = response_json[i].name;
                document.name = response_json[i].name;
                data.push(document);
            }
        } catch (ex) {
            var dummyDoc = new Object();
            dummyDoc.label = '<No Buckets retrieved>';
            dummyDoc.name = null;
            data.push(dummyDoc);
        } finally {
            documents.data = data;
            outputs.documents = documents;
            outputs.status = "Success";
        }
    } 
  else {
        var errMsgs = new OciObjectStorageManagement_ErrorHandler().errorHandler(inputs.responseBody);
        outputs.error_message = errMsgs[0];
        outputs.status = errMsgs[1];
    }
})(inputs, outputs);

